
namespace Auth.Infrastructure.Data
{
    public static class AuthSeed
    {
        public static async Task SeedAsync(
          ApplicationDbContext context,
          UserManager<ApplicationUser> userManager,
          RoleManager<IdentityRole> roleManager)
        {
           
            await context.Database.MigrateAsync();

           
            string[] roles = new[] { "Doctor", "Patient" };

            foreach (var role in roles)
            {
                if (!await roleManager.RoleExistsAsync(role))
                {
                    await roleManager.CreateAsync(new IdentityRole(role));
                }
            }

            
            var doctorId = "8d7c6b5f-09f4-4b22-a6a8-3b7dbe4f92f2"; 
            var doctorEmail = "ikanoviczeljko095@gmail.com";

            if (await userManager.FindByIdAsync(doctorId) == null)
            {
                var doctor = new ApplicationUser
                {
                    Id = doctorId,
                    UserName = doctorEmail,
                    NormalizedUserName = doctorEmail.ToUpper(),
                    Email = doctorEmail,
                    NormalizedEmail = doctorEmail.ToUpper(),
                    FirstName = "John",
                    LastName = "Smith",
                    EmailConfirmed = true,
                    PhoneNumber = "+123456789",
                    PhoneNumberConfirmed = true,
                    TwoFactorEnabled = true,
                    LockoutEnabled = true,
                    AccessFailedCount = 0,
                    ProfilePictureUrl = "",
                    CreatedAt = DateTime.UtcNow,
                    UpdatedAt = DateTime.UtcNow,
                    IsDeleted = false
                };

                var result = await userManager.CreateAsync(doctor, "Doctor123!");
                if (result.Succeeded)
                {
                    await userManager.AddToRoleAsync(doctor, "Doctor");
                }
            }

           
            var patientId = "c5a59d9e-02b4-4c72-a5e4-2c76b6d53133"; 
            var patientEmail = "ikanoviczeljko362@gmail.com";

            if (await userManager.FindByIdAsync(patientId) == null)
            {
                var patient = new ApplicationUser
                {
                    Id = patientId,
                    UserName = patientEmail,
                    NormalizedUserName = patientEmail.ToUpper(),
                    Email = patientEmail,
                    NormalizedEmail = patientEmail.ToUpper(),
                    FirstName = "Maria",
                    LastName = "Gonzalez",
                    EmailConfirmed = true,
                    PhoneNumber = "+987654321",
                    PhoneNumberConfirmed = true,
                    TwoFactorEnabled = true,
                    LockoutEnabled = true,
                    AccessFailedCount = 0,
                    ProfilePictureUrl = "",
                    CreatedAt = DateTime.UtcNow,
                    UpdatedAt = DateTime.UtcNow,
                    IsDeleted = false
                };

                var result = await userManager.CreateAsync(patient, "Patient123!");
                if (result.Succeeded)
                {
                    await userManager.AddToRoleAsync(patient, "Patient");
                }
            }
        }
    }
}
